import React from "react";
import ReactDOM from 'react-dom'
import {responsive} from './responsive.js'
import {Main} from './index.js'
import accountimg from './account.png'
export class Heading extends React.Component{
    constructor(){
        super()
        this.state={style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg)}
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',this.resize);
        window.addEventListener('scroll',this.resize);
    }
    resize(){
        this.setState({style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg)});
    }
    render(){
        return(
            <div style={this.state.style}>
            <button style={this.state.h1}onClick={()=>{ReactDOM.render(<Main logged_in={true}/>,document.getElementById('root'))}}>
                Binary.c
            </button>
            <button style={this.state.account}></button>
            <hr/>
            </div>
        )
    }
}
